class MyLotteryActivity : AppCompatActivity() {

    //메인 메뉴에서 "당첨내역" 탭 onclick시, 당첨내역 리사이클러뷰 화면

    val networkService: NetworkService by lazy {
        ApplicationController.instance.networkService
    }

    var dataList : ArrayList<MyLotteryData> = ArrayList()

    override fun onCreate(savedInstanceState: Bundle?) {
        super.onCreate(savedInstanceState)
        setContentView(R.layout.activity_my_lottery)

        tb_title.text = "당첨내역"
        iv_back.setOnClickListener {
            finish()
        }

        /*var dataList: ArrayList<MyLotteryData> = ArrayList()
        dataList.add(MyLotteryData("data:image/jpeg;base64,", "1997년 02월 15일",
            "뮤지컬 벤허", "일반 R석 20,000원", "블루스퀘어 인터파크홀", "17:00~19:00", 1))
        dataList.add(MyLotteryData("data:image/jpeg;base64,", "1997년 02월 15일",
            "뮤지컬 벤허", "일반 R석 20,000원", "블루스퀘어 인터파크홀", "17:00~19:00", 2))*/

        getMyLotteryResponse()
    }

    private fun setRecyclerView() {
        val adapter = MyLotteryRVAdapter(this, dataList)
        adapter.itemClick = object: MyLotteryRVAdapter.ItemClick {
            override fun onClick(view: View, position: Int) {
                val intent: Intent = Intent(this@MyLotteryActivity, MyLotteryDetailActivity::class.java)
                intent.putExtra("idx", 20) //show_idx 전달
            }
        }
        rv_mylottery.adapter = adapter
        rv_mylottery.layoutManager = LinearLayoutManager(this)
    }

    private fun getMyLotteryResponse() {
        val token = SharedPreferenceController.getUserToken(this@MyLotteryActivity)

        val getMyLotteryResponse = networkService.getMyLotteryResponse("application/json", token)
        getMyLotteryResponse.enqueue(object: Callback<GetMyLotteryResponse> {
            override fun onFailure(call: Call<GetMyLotteryResponse>, t: Throwable) {
                Log.e("*****MyLottActivity:: ", "List_MyLotteryData_Failed::" + t.toString())
            }

            override fun onResponse(call: Call<GetMyLotteryResponse>, response: Response<GetMyLotteryResponse>) {
                if (response.isSuccessful) {
                    var tempData: ArrayList<MyLotteryData> = response.body()!!.data
                    if (tempData != null) {
                        dataList = response.body()!!.data
                    }
                    if (tempData.isEmpty()){
                        mylottery_empty_image.visibility = View.VISIBLE
                        rv_mylottery.visibility = View.GONE
                    }
                    Log.e("*****MyLottActivity:: ", "getMyLotteryResponse::Success" + dataList.toString())

                    setRecyclerView()

                }
                else {
                    Log.e("*****MyLottActivity:: ", "getMyLotteryResponse::Fail" + dataList.toString())
                }
            }
        })
    }

}